const CryptoJS = require('crypto-js');
let a = "3sd&d2"
    , o = "4h@$udD2s"
    , s = "*";

function decryptData(n, e) {
    e = e || "".concat(a).concat(o).concat(s);
    var t = CryptoJS.enc.Utf8.parse(e)
        , c = CryptoJS.AES.decrypt(n, t, {
        mode: CryptoJS.mode.ECB,
        padding: CryptoJS.pad.Pkcs7
    });
    return CryptoJS.enc.Utf8.stringify(c).toString()
}
